import React from 'react'
import { userContext , idContext} from '../App'

const ComponentC = () => {
    return (
        <div>
            <userContext.Consumer>
               {
                user=>{
                    return(
                        <div>userContext vale is {user}</div>
                    )
                }
               }
            </userContext.Consumer>
        </div>
    )
}

export default ComponentC
